import React from "react";
import SimpleMDE from "react-simplemde-editor";
import "easymde/dist/easymde.min.css";

const MDEditor = (props) => {
    return (
        <div class="editor">
            <SimpleMDE value={props.content} />
        </div>
    );
}


export default MDEditor;
